    render(){
        return(
            <div class="page">
                <div className="container">
                    <h1 className="titulo"> Infinity </h1>

                    <div className="campo">
                        <label className="labelLogin"> Usuário </label> <br/>
                        <input type="text" placeholder="Usuário" id="userLogin" name="userLogin" className="formLogin"/>
